    false,nt"url": null,nt"notes": "NCEI Accession 0108121 includes discrete
    sample and profile data collected from MIRAI in the North Pacific Ocean from 2007-07-24
    to 2007-09-03 and retrieved during cruise CLIVAR_P01_2007. These data include CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
    tetrachloride (CCL4), DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON
    (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential temperature
    (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, pH, phosphate and silicate.
    The instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
    for DIC measurement, bottle and spectrophotometer.nnThese data were collected by
    Akihiko Murata, Masao Fukasawa and Takeshi Kawano of Japan Agency for Marine-Earth
    Science and Technology (JAMSTEC) as part of the CLIVAR_P01_2007 data set.nnThe International
    CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
    and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
